import React, { Component } from "react";
import { Grid, Cell, ProgressBar } from "react-mdl";

class Skills extends Component {
  render() {
    return (
      <Grid>
        <Cell col={12}>
          <div style={{ display: "flex" }}>
            {this.props.skill}{" "}
            <ProgressBar
              style={{
                paddingTop: "1%",
                width: "70%",
                margin: "auto"
              }}
              progress={this.props.progress}
            />{" "}
          </div>
        </Cell>
      </Grid>
    );
  }
}

export default Skills;
